Come February and the world starts talking about one emotion that binds all...Love. This Valentine’s Day the Times of India spoke to a Mumbai-based not so regular couple for the society. Inder Vhatwar and Ashish Srivastava have been living together as a couple for the past 8 years. They shared their life experiences of being in a same-sex relationship in India. During their conversation with the TOI, Inder and Ashish revealed how love is a struggle for queer relationships.

Thank you @imemanisha and @timesofindia of sharing our story this Valentine’s Day. Makes it even more special. 

